def render_chart(request, html_content, fig):
    # Define layout with autosize enabled
    fig.update_layout(
        autosize=True
    )
    plot_div = plot(
        fig,
        output_type='div',
        include_plotlyjs=True,
        config={
            'responsive': True,
            'displayModeBar': True,
            'displaylogo': False
        }
    )

    context = {
        'content_html': html_content,
        'plot_div': plot_div
    }
    return render(request, 'plotly_3d_chart.html', context)